modulos =[]load "videosTr.gz";#Ejercicio1function [modulo] = calcularModulo(matr)  sum = 0;  for i =matr   sum+=i**2;  end;  modulo =sqrt(sum); end;[Row,Column] =size(data);for x = 1:Row  modulos(end+1) = calcularModulo(data(x,1:Column-1));end;#Ejercicio2#Ejercicio 3 vectores unitariosfunction[dataUnitaria] = calcularVecoresUnitarios(data,modulos)  dataUnitaria = []  [Row,Column] =size(data);  for x= 1:Row    dataUnitaria(x,:)= data(x,1:Column-1) ./modulos(x);    dataUnitaria(x,end)=data(x,end)  end;end;[Row,Column] =size(data);p = calcularVecoresUnitarios(data(:,1:Column-1),modulos(:))